import React from 'react';
import MedicItem from './MedicItem';

function MedicsList(props) {
    const filteredMedics = props.medics.filter(
        (medic) =>
            medic.name.toLowerCase().includes(props.searchTerm.toLowerCase()) ||
            medic.description.toLowerCase().includes(props.searchTerm.toLowerCase())
    );

    return (
        <ul>
            {filteredMedics.map((medic, index) => (
                <MedicItem
                    key={index}
                    name={medic.name}
                    description={medic.description}
                    image={medic.image}
                />
            ))}
        </ul>
    );
}

export default MedicsList;
